import './App.scss';

function App() {
  return (
    <div className="trello-phi-main">
      <nav className='navbar app'>App Bar</nav>
      <nav className='navbar board'>Board Bar</nav>
      <div className='board-colums'>

        <div className='column'>
        <header>BrainStorm</header>
        <ul>
          <li>
            <img src='https://vtv1.mediacdn.vn/thumb_w/650/2019/7/18/12654602101538696692846753128890951271157684n-1563420062461130424819-crop-15634200735851613593101.jpg' alt="phi-img"/>
            Title:Phi
             </li>
          <li>Add what you'd to work on below</li>
        </ul>
        <footer>Add another card</footer>
        </div>


      </div>
      </div>
  );
}

export default App;
